import React, { Component } from 'react';
import {
    Form,
    Input,
    Button,
} from 'antd'
import './register.css'

const formItemLayout = {
    labelCol: {
      xs: { span: 24 },
      sm: { span: 8 },
    },
    wrapperCol: {
      xs: { span: 24 },
      sm: { span: 16 },
    },
  };
  const tailFormItemLayout = {
    wrapperCol: {
      xs: {
        span: 24,
        offset: 0,
      },
      sm: {
        span: 16,
        offset: 8,
      },
    },
  };

export default class UserRegister extends Component {

    onFinish = (values) => {
        console.log('Received values of form: ', values);
    }

    render() {
        return (
            <div>
                <div className="user-register">
                    <Form
                        {...formItemLayout}
                        name="register"
                        onFinish={this.onFinish}
                        scrollToFirstError
                    >
                        <Form.Item
                            name="phone"
                            label="手机号码"
                            rules={[{ required: true, message: '请输入手机号码！' }]}
                            style={{ width: '400px' }} 
                        >
                            <Input/>
                        </Form.Item>
                        <Form.Item
                            name="password"
                            label="密码"
                            rules={[
                                {
                                    required: true,
                                    message: '请输入密码！',
                                },
                            ]}
                            hasFeedback
                            style={{ width: '400px' }}
                        >
                            <Input.Password />
                        </Form.Item>

                        <Form.Item
                            name="confirm"
                            label="确认密码"
                            dependencies={['password']}
                            hasFeedback
                            style={{ width: '400px' }}
                            rules={[
                                {
                                    required: true,
                                    message: '请输入确认密码！',
                                },
                                ({ getFieldValue }) => ({
                                    validator(_, value) {
                                        if (!value || getFieldValue('password') === value) {
                                            return Promise.resolve();
                                        }
                                        return Promise.reject(new Error('两次密码不一致！'));
                                    },
                                }),
                            ]}
                        >
                            <Input.Password/>
                        </Form.Item>
                        <Form.Item {...tailFormItemLayout} style={{marginRight:'100px'}}>
                            <Button type="primary" htmlType="submit">
                                注册
                            </Button>
                        </Form.Item>
                    </Form>
                </div>
            </div>
        )
    }
}
